const About = () => {
    return (
        <div className='about'>
            <h1> heelloow worrd</h1>
            <div className='about_box flex items-center'>
                <h1> About me</h1>
                 <img id="profile_pic" alt="Profile Pic" title="Profile Pic" className="profile_pic" src={profile_pic}></img>

            </div>
        </div>
    )
}



export default About;
